import React from 'react';
import { SafeAreaView, Text, View } from 'react-native';
import TopBar from '../../components/Common/TopNavBar';

const ExploreServices = () => {
  return (
    <SafeAreaView >
      <TopBar />
      <Text>ExploreServicesScreen</Text>
    </SafeAreaView>
  );
};

export default ExploreServices;
